import "./subNav.css"
import { NavLink } from "react-router-dom";
import useGlobalState from "../../Store_&_State/GlobalState"
import { useState, useEffect } from 'react';

import React from 'react';

const SubNav = () => {
  const {search, setSearch} = useGlobalState('');

  useEffect(() => {
    const subNav_selected = document.getElementsByClassName('subNav_selected')
    // const subNav_selected = document.getElementsByClassName('subNav_selected')
  }, []);

    return (
        <span id="subNav">
            <div id="subNav_overlay">
                {/* <li><NavLink to="/"></NavLink></li> */}

                <NavLink className="NavLink" activeClassName="active" to="/">
                    <div className='subNav_selected' onhv>
                        <div id="subNav_recurring_record"></div>
                        <p>Recurring record</p>
                    </div>
                </NavLink>

                <NavLink className="NavLink" activeClassName="active" to="/">
                    <div  className='subNav_selected'>
                        <div id="subNav_convert_to_pdf"></div>
                        <p>Convert to PDF</p>
                    </div>
                </NavLink>

                {/* <div  className='subNav_selected'> */}
                    <input type="text" value={search} placeholder="Search" onChange={(e)=>{setSearch(e.target.value)}}/>
                {/* </div> */}

                <NavLink className="NavLink" activeClassName="active"  to="/">
                    <div  className='subNav_selected'>
                        <div id="subNav_graphs"></div>
                        <p>Graphs</p>
                    </div>
                </NavLink>

                <NavLink className="NavLink" activeClassName="active" to="/ledger/ratios">
                    <div  className='subNav_selected'>
                        <div id="subNav_ratios"></div>
                        <p>Ratios</p>
                    </div>
                </NavLink>

                <NavLink className="NavLink" activeClassName="active" to="/ledger/filtter">
                    <div  className='subNav_selected'>
                        <div id="subNav_filtter"></div>
                        <p>Filtter</p>
                    </div>
                </NavLink>

                <NavLink className="NavLink" activeClassName="active" to="/">
                    <div  className='subNav_selected'>
                        <div id="subNav_settings"></div>
                        <p>Settings</p>
                    </div>
                </NavLink>
            </div>
        </span>

    );
}

export default SubNav;
